script: |
  super -f text -I q2353.spq | sort > q2353.out

inputs:
  - name: q2353.spq
    data: |
      SELECT ALL + 68 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - col0 ) + col1 - - + col1 * - + col2 NOT BETWEEN + 68 + col1 / + col1 AND col0 * + + col1 * col0 + - + col2 * - col0;
  - name: tab0

outputs:
  - name: q2353.out
    data: |
